import styles from "./../assets/pages/Servidor.module.css";
import { Chart as ChartJS, ArcElement, Tooltip, Legend } from "chart.js"
import { Doughnut } from "react-chartjs-2";
import { useState, useEffect } from "react";

function Servidor(){

    const [GraphicLeft, setGraphicLeft] = useState({data: null, options: null})
    const [GraphicRight, setGraphicRight] = useState({data: null, options: null})

    useEffect(() => {
        ChartJS.register(ArcElement, Tooltip, Legend);
    }, []); 

    return (
        <div style={{background: "#eee"}}>
            <div className={styles.containerServidor}>
                <p>Informações do Sercidor</p>
                <div className={styles.contentServidor}>
                    <div className={styles.useDisk}>
                        <div>
                            {GraphicLeft && <Doughnut data={GraphicLeft.data}/>}
                        </div>
                        <div>

                        </div>
                    </div>
                    <div className={styles.useGraphic}>

                    </div>
                </div>
            </div>
        </div>
    )
}

export default Servidor;
